export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},H181NMIaYE:{data:{id:335,attributes:{imdbId:"tt0078872",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzgzOTgwOTEzM15BMl5BanBnXkFtZTcwMzI2MTcyNA@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"84\u002F100"}],item_lang:{data:{id:998,attributes:{title:"The Black Stallion",plot:"While traveling with his father, young Alec becomes fascinated by a mysterious Arabian stallion who is brought on board and stabled in the ship he is sailing on. When it tragically sinks both he and the horse survive only to be stranded on a desert island. He befriends it, so when finally rescued, both return to his home where they soon meet Henry Dailey, a once-successful trainer. Together they begin training the stallion to race against the fastest horses in the world.",slug:"the-black-stallion"}}},books:{data:[{id:3131,attributes:{title:"The Black Stallion and Flame",description:"While flying to a race, Alec Ramsay and the Black’s plane crash-lands in the stormy Caribbean. Chance brings the Black to the hidden island home of the giant red stallion, Flame. Such a small island can only support one alpha male. But before the two can fight–a fight that can only result in the death of one–a new danger appears. Together, can the stallions defeat the deadly foe which threatens the lives of the entire herd of wild horses?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OfTkSc6_GW0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:f,publisher:c,subtitle:d}},{id:3132,attributes:{title:"The Black Stallion Mystery",description:"Someone's set a treacherous trap for Alec and his horse...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8agujcDLa6gC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:g,published:"1992-01-01",publisher:c,subtitle:d}},{id:3133,attributes:{title:"The Black Stallion's Courage",description:"When Hopeful Farm burns down, Alec’s dreams for the future go up in smoke. How can he get the money to rebuild? To make matters worse, a strong young colt named Eclipse has taken the racing world by storm, threatening to replace the Black in the hearts of racing fans. Against all odds, Alec sets out to save the farm and prove that the Black is still the greatest race horse of all time! “Everyone loves a champion. And when the champion is a gallant horse, when his story is told by a champion writer of horse stories, every reader is a winner.”—The New York Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c-gvB2Sq9_kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:f,publisher:c,subtitle:d}},{id:3134,attributes:{title:"The Black Stallion Returns",description:"In this, the second book in the series, the heart-stopping adventures of the Black Stallion continue as Alec discovers that two men are after the Black. One claims to be the Black’s rightful owner and one is trying to kill the beautiful steed. An Arab chieftain proves his ownership of the Black and takes him away, but Alec is determined to find his horse again. Following the pair to Arabia, Alec encounters great evil and intrigue, as only a horse as spectacular as the Black could inspire.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lezIWBHOKBwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:f,publisher:c,subtitle:d}},{id:3135,attributes:{title:"The Black Stallion Revolts",description:"After the Black attacks another horse, Alec realizes that the once-wild horse needs more space and freedom, so they head out west to a huge ranch. But a terrible accident separates the two, leaving Alec with amnesia and the Black alone to reclaim the wild life to which he was born. As the Black struggles to survive, and as Alec struggles to remember who he is and his connection to the magnificent stallion in the canyon, a gripping adventure story unfolds.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=faa3EY2fchgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:g,published:f,publisher:c,subtitle:d}}]}}},meta:{}}},prerenderedAt:1688531279064}}("movie","Walter Farley","Yearling","","series","2011-09-28",null,1))